export default function Layout() {
  return (
    <div className="card-component-shadow w-[400px] h-[550px] relative bg-[var(--shadow1)] rounded-2xl z-[2] flex flex-col items-center justify-center">
      <div className="card-component-main w-[80%] h-[80%] bg-[var(--card-bg)] z-[4] rounded-xl p-4">
        <div className="card-component-img">
          <img
            className="rounded-md h-[55]"
            src={require("../images/image-equilibrium.jpg")}
          ></img>
        </div>
      </div>
    </div>
  );
}
